import React from "react";

const HeaderUser = () => {
  return (
    <div>
      <header>
        <nav className="navbar navbar-expand-md navbar-dark bg-dark">
          <div>
            <a href="http://localhost:3000/" className="navbar-brand">
              Log out
            </a>
          </div>
        </nav>
      </header>
    </div>
  );
};

export default HeaderUser;
